    padding: "0 5 5",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    margin: 50,
  },
});

const movies = [
    {
        name: "Gunpowder Milkshake",
        imgPath: "http://127.0.0.1:5000/static/images/gunpowder.jpg",
